        "lastName": inputs.deductions.owner.last_name.toString()
  },
  "timestamp": {
    "createdDateTime": createdDate,
    "modifiedDateTime": modifiedDate
  },
  "createdBy": {
      "enterpriseColleagueId": inputs.deductions.created_by.hashed_user_id.toString(),
        "firstName": inputs.deductions.created_by.first_name.toString(),
        "lastName": inputs.deductions.created_by.last_name.toString()

  },
  "modifiedBy": {
      "enterpriseColleagueId": inputs.deductions.sys_updated_by.hashed_user_id.toString(),
        "firstName": inputs.deductions.sys_updated_by.first_name.toString(),
        "lastName": inputs.deductions.sys_updated_by.last_name.toString()
      }
      ,
  "deductionItems": [
    {
      "deductionType":inputs.child_deduction.deduction_type.toString(),
      "deductionAmount": inputs.child_deduction.deduction_amount.toString(),
      "createdOn": createdOn,
      "createdBy": {
       "enterpriseColleagueId": inputs.deductions.created_by.hashed_user_id.toString(),
        "firstName": inputs.deductions.created_by.first_name.toString(),
        "lastName": inputs.deductions.created_by.last_name.toString()
      }
    },
    {
      "deductionType": inputs.child_deduction.deduction_type.toString(),
      "deductionAmount": inputs.child_deduction.deduction_amount.toString(),
      "createdOn": createdOn,
      "createdBy": {
        "enterpriseColleagueId": inputs.deductions.created_by.hashed_user_id.toString(),
